import React, { Component } from "react";
import "./MickeyCard.css";

class Card extends Component {
  render() {
    return (
      <div className="wrapper">
        <div className="card">
          <div className="img-container">
            <img
              src={this.props.image}
              alt="-mickey-character"
              onClick={this.props.click}
            />
          </div>
        </div>
      </div>
    );
  }
}

export default Card;
